ct_base_info`.`total_r_reat_ee` AS `3相总反向无功电能(total_r_reat_ee)`,`collect_base_info`.`total_at_ee` AS `3相总有功电能(total_at_ee)`,`collect_base_info`.`tip_total_at_ee` AS `尖时段总有功电能(tip_total_at_ee)`,`collect_base_info`.`peak_total_at_ee` AS `峰时段总有功电能(peak_total_at_ee)`,`collect_base_info`.`flat_total_at_ee` AS `平时段总有功电能(flat_total_at_ee)`,`collect_base_info`.`valley_total_at_ee` AS `谷时段总有功电能(valley_total_at_ee)`,`collect_base_info`.`tip_total_ap_reat_ee` AS `尖时段总无功电能(tip_total_ap_reat_ee)`,`collect_base_info`.`peak_total_ap_reat_ee` AS `峰时段总无功电能(peak_total_ap_reat_ee)`,`collect_base_info`.`flat_total_ap_reat_ee` AS `平时段总无功电能(flat_total_ap_reat_ee)`,`collect_base_info`.`valley_total_ap_reat_ee` AS `谷时段总无功电能(valley_total_ap_reat_ee)`,`collect_base_info`.`tip_total_ap_a_ee` AS `尖时段总视在电能(tip_total_ap_a_ee)`,`collect_base_info`.`peak_total_ap_a_ee` AS `峰时段总视在电能(peak_total_ap_a_ee)`,`collect_base_info`.`flat_total_ap_a_ee` AS `平时段总视在电能(flat_total_ap_a_ee)`,`collect_base_info`.`valley_total_ap_a_ee` AS `谷时段总视在电能(valley_total_ap_a_ee)`,`collect_base_info`.`frequency` AS `频率(frequency)`,`collect_base_info`.`uab_line_voltage` AS `A,B两相线电压(uab_line_voltage)`,`collect_base_info`.`ubc_line_voltage` AS `B,C两相线电压(ubc_line_voltage)`,`collect_base_info`.`uac_line_voltage` AS `A,C两相线电压(uac_line_voltage)` from `collect_base_info` ;

